import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import React, {Component} from "react";
import LoginIcon from '@material-ui/icons/AlternateEmail';
import './login.css'

class Login extends Component {
    render() {
        return (
            <Container>
                <Form>
                    <LoginIcon color="red" fontSize="large"></LoginIcon>
                    <Form.Group class="mar" controlId="form.Email">
                        <Form.Control type="email" placeholder="이메일" />
                    </Form.Group>
                    <Form.Group controlId="form.Password">
                        <Form.Control type="password" placeholder="비밀번호" />
                    </Form.Group>
                    <Button variant="success" onClick={'www.naver.com'}>Login</Button>
                </Form>
            </Container>
        );
    }
}

export default Login;
